import React from "react";
import "./Header.css";

export default function Header({ title }) {
  return (
    <header className="header">
      <h1>{title}</h1>

      <div className="header-user">
        <img
          src="https://i.pravatar.cc/40"
          alt="User Avatar"
          className="header-avatar"
        />
      </div>
    </header>
  );
}
